<script>

/**
 * jQuery Plugin: Sticky Tabs
 *
 * @author Aidan Lister <aidan@php.net>
 * adapted by Ruben Arslan to activate parent tabs too
 * http://www.aidanlister.com/2014/03/persisting-the-tab-state-in-bootstrap/
 */
(function($) {
  "use strict";
  $.fn.rmarkdownStickyTabs = function() {
    var context = this;
    // Show the tab corresponding with the hash in the URL, or the first tab
    var showStuffFromHash = function() {
      var hash = window.location.hash;
      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';
      var $selector = $(selector, context);
      if($selector.data('toggle') === "tab") {
        $selector.tab('show');
        // walk up the ancestors of this element, show any hidden tabs
        $selector.parents('.section.tabset').each(function(i, elm) {
          var link = $('a[href="#' + $(elm).attr('id') + '"]');
          if(link.data('toggle') === "tab") {
            link.tab("show");
          }
        });
      }
    };


    // Set the correct tab when the page loads
    showStuffFromHash(context);

    // Set the correct tab when a user uses their back/forward button
    $(window).on('hashchange', function() {
      showStuffFromHash(context);
    });

    // Change the URL when tabs are clicked
    $('a', context).on('click', function(e) {
      history.pushState(null, null, this.href);
      showStuffFromHash(context);
    });

    return this;
  };
}(jQuery));

window.buildTabsets = function(tocID) {

  // build a tabset from a section div with the .tabset class
  function buildTabset(tabset) {

    // check for fade and pills options
    var fade = tabset.hasClass("tabset-fade");
    var pills = tabset.hasClass("tabset-pills");
    var navClass = pills ? "nav-pills" : "nav-tabs";

    // determine the heading level of the tabset and tabs
    var match = tabset.attr('class').match(/level(\d) /);
    if (match === null)
      return;
    var tabsetLevel = Number(match[1]);
    var tabLevel = tabsetLevel + 1;

    // find all subheadings immediately below
    var tabs = tabset.find("div.section.level" + tabLevel);
    if (!tabs.length)
      return;

    // create tablist and tab-content elements
    var tabList = $('<ul class="nav ' + navClass + '" role="tablist"></ul>');
    $(tabs[0]).before(tabList);
    var tabContent = $('<div class="tab-content"></div>');
    $(tabs[0]).before(tabContent);

    // build the tabset
    var activeTab = 0;
    tabs.each(function(i) {

      // get the tab div
      var tab = $(tabs[i]);

      // get the id then sanitize it for use with bootstrap tabs
      var id = tab.attr('id');

      // see if this is marked as the active tab
      if (tab.hasClass('active'))
        activeTab = i;

      // remove any table of contents entries associated with
      // this ID (since we'll be removing the heading element)
      $("div#" + tocID + " li a[href='#" + id + "']").parent().remove();

      // sanitize the id for use with bootstrap tabs
      id = id.replace(/[.\/?&!#<>]/g, '').replace(/\s/g, '_');
      tab.attr('id', id);

      // get the heading element within it, grab it's text, then remove it
      var heading = tab.find('h' + tabLevel + ':first');
      var headingText = heading.html();
      heading.remove();

      // build and append the tab list item
      var a = $('<a role="tab" data-toggle="tab">' + headingText + '</a>');
      a.attr('href', '#' + id);
      a.attr('aria-controls', id);
      var li = $('<li role="presentation"></li>');
      li.append(a);
      tabList.append(li);

      // set it's attributes
      tab.attr('role', 'tabpanel');
      tab.addClass('tab-pane');
      tab.addClass('tabbed-pane');
      if (fade)
        tab.addClass('fade');

      // move it into the tab content div
      tab.detach().appendTo(tabContent);
    });

    // set active tab
    $(tabList.children('li')[activeTab]).addClass('active');
    var active = $(tabContent.children('div.section')[activeTab]);
    active.addClass('active');
    if (fade)
      active.addClass('in');

    if (tabset.hasClass("tabset-sticky"))
      tabset.rmarkdownStickyTabs();
  }

  // convert section divs with the .tabset class to tabsets
  var tabsets = $("div.section.tabset");
  tabsets.each(function(i) {
    buildTabset($(tabsets[i]));
  });
};

</script>

<style type="text/css">body {background-color: #1e0000;}.nav-pills {padding-left: 15px;}.old {border-radius: 10px;background-color: #500605;padding-bottom: 10px;}.centered-text {text-align: center;}.justify {text-align: justify;text-justify: inter-word;}.bold {font-weight: bold;}.book,.gridbook,.linebook {padding-bottom: 10px;padding-left: 5px;padding-top: 10px;border-radius: 5px;font-family: "URW Chancery L", "cursive";background-color: #9d331f;}.book {padding: 5px;color: #f0810f;margin-left: 5px;margin-right: 5px;font-style: oblique;}.gridbook {color: #e6df44;border: 2px dashed rgb(95, 94, 92);box-shadow: 0 0 0 3px #1e0000;background-size: 20px 20px;background-image: linear-gradient( to right, rgba(128, 128, 128, 0.25) 1px, transparent 1px), linear-gradient(to bottom, rgba(128, 128, 128, 0.25) 1px, transparent 1px);}.linebook {border: 2px dashed #1e0000;box-shadow: 0 0 0 3px #1e0000;background-size: 20px 20px;background-image: linear-gradient( to bottom, rgba(128, 128, 128, 0.25) 1px, transparent 1px);color: #e6df44;}img {width: 100%;border-radius: 5px;}.zoom {transition: all 0.5s;}.zoom:hover {transform: scale(2, 2);position: static;top: 50%;left: 50%;}.zoom25 {transition: all 0.5s;}.zoom25:hover {transform: scale(1.5, 1.5);position: static;top: 50%;left: 50%;}p {margin-left: 20px;margin-right: 20px;}h1 {font-family: "Times New Roman", Times, serif;text-align: center;}h1,h2,h3,h4,h5,h6 {margin-right: 10px;}h1,h2,h3,h4,h5,h6,td,p,th,li {color: #ffcd94;}a {color: #ff6141;}a:hover {color: #cf2300;}.nav-pills>li.active>a,.nav-pills>li.active>a:focus,.nav-pills>li.active>a:hover {color: #1e0000;background: radial-gradient( circle, rgba(63, 94, 251, 0) 47%, rgba(255, 205, 148, 1) 100%);background-color: rgba(255, 205, 148, 0.425);}.nav-pills>li>a:hover {background: radial-gradient( circle, rgba(255, 205, 148, 0) 12%, rgba(255, 205, 148, 0.5494572829131652) 100%);background-color: transparent;}h2 {margin-left: 10px;}h3 {margin-left: 20px;}h4 {margin-left: 30px;}h5 {margin-left: 40px;}h6 {margin-left: 50px;}.biggerOnHover {transition: margin 0.5s;}.biggerOnHover:hover {margin-left: 5%;margin-right: 5%;}.cardOnHover {transition: all 0.5s;}.cardOnHover:hover {margin-left: 5%;margin-right: 5%;font-size: x-large;transition: all 0.5s;}.halfSize {margin-left: 25%;margin-right: 25%;}.halfSizeLeft {margin-left: 10%;margin-right: 40%;}.halfSizeRight {margin-left: 40%;margin-right: 10%;}.threeQuartersSize {margin-left: 12.5%;margin-right: 12.5%;}.textsmaller {font-size: smaller;}.textsmall {font-size: small;}.textnormal {font-size: medium;}.textlarge {font-size: large;}.textLarge {font-size: x-large;}.textLARGE {font-size: xx-large;}.cropAlin {padding-left: 12.5%;padding-right: 12.5%;object-position: 45% 13%;height: 400px;object-fit: cover;transition: all 0.5s;}.cropAlin:hover {padding-left: 0%;padding-right: 0%;object-position: 45% 0px;height: 1819px;}.object-fit-cover {object-position: 100% 0%;object-fit: cover;}.circle {border-radius: 100%;object-position: 50% 0%;object-fit: cover;width: 23em;height: 23em;transition: all 0.5s;}.circle:hover,.round:hover {object-fit: contain;border-radius: 0%;object-position: 50% 50%;}.token {border-radius: 100%;}.round {border-radius: 100%;object-position: 50% 0%;object-fit: cover;width: 100%;height: 100%;transition: all 0.5s;}</style>

<style type="text/css">
.tabset-dropdown > .nav-tabs {
  display: inline-table;
  max-height: 500px;
  min-height: 44px;
  overflow-y: auto;
  border: 1px solid #ddd;
  border-radius: 4px;
}

.tabset-dropdown > .nav-tabs > li.active:before {
  content: "";
  font-family: 'Glyphicons Halflings';
  display: inline-block;
  padding: 10px;
  border-right: 1px solid #ddd;
}

.tabset-dropdown > .nav-tabs.nav-tabs-open > li.active:before {
  content: "";
  border: none;
}

.tabset-dropdown > .nav-tabs.nav-tabs-open:before {
  content: "";
  font-family: 'Glyphicons Halflings';
  display: inline-block;
  padding: 10px;
  border-right: 1px solid #ddd;
}

.tabset-dropdown > .nav-tabs > li.active {
  display: block;
}

.tabset-dropdown > .nav-tabs > li > a,
.tabset-dropdown > .nav-tabs > li > a:focus,
.tabset-dropdown > .nav-tabs > li > a:hover {
  border: none;
  display: inline-block;
  border-radius: 4px;
  background-color: transparent;
}

.tabset-dropdown > .nav-tabs.nav-tabs-open > li {
  display: block;
